            return False

        return True

    def parse_grammar(grammar, s):
        grammar_tree = {}

        # Create a dictionary to hold the grammar
        grammar_tree['S'] = 'S'

        for element in grammar:
            if isinstance(element, str):
                grammar_tree[element] = 'S'
            else:
                grammar_tree[element] = 'S'

        return grammar_tree


    if check_grammar(s, s):
        print("Yes")
    else:
        print("No")

solve()
